import './App.css';

import Card from './Components/Card';
import data from "./Components/data";

function cardarr( i )
{
  return(
      <Card 
        title = {i.title}
        imglink = {i.imglink}
        info = {i.info}
      />
  )
}

function App() {
  return(
    <div className="App">

      <div className="cardblock">

        { data.map( (i) ) }

      </div>

    </div>
  );
}

export default App;
